  public shown: boolean = false;

  public get modalClasses(): string[] {
    const isFullSize = this.fullSize ? 'full-size' : 'regular-size';
    return [ isFullSize ];
  }

  ngOnInit(): void {
    if (this.toParams) {
      this.params = this.toParams;
    }
  }

  showModal($event):void {
    this.shown = true;
  }

  signUp($event): void {
    console.log('sign up');
    this.shown = false;
  }
}

